INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, "青空の下で謁見", 10118, 8, 0, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 7, "フリーマーケット会場", 5118061, "ペコリーヌとの出会い", 2, 1, 40, 91002, 2834);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, "未来の騎空団\nマスコット？", 10118, 8, 0, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 7, "フリーマーケット会場", 5118062, "マホとの出会い", 2, 1, 40, 91002, 2835);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, "お嬢さまからの\n緊急依頼", 10118, 8, 0, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 7, "ランドソル市街地", 5118063, "アキノとの出会い", 2, 1, 40, 91002, 2837);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, "黄金色の悩みごと", 10118, 8, 0, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 18, "フリーマーケット会場", 5118064, "ジュンとの出会い", 2, 1, 40, 91002, 4108402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, "白熱！　格闘大会！", 10118, 8, 0, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 18, "フリーマーケット会場", 5118065, "カオリとの出会い", 2, 1, 40, 91002, 4107402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, "祭り太鼓はオーエドの華", 10118, 8, 1, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 16, "オーエド町", 5118066, "ニノンとの出会い", 2, 1, 40, 91002, 9000227);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, "人気者は遅れて\nやってくる", 10118, 8, 0, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 19, "フリーマーケット会場", 5118067, "スズナとの出会い", 3, 1, 40, 91002, 2101181);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, "巫女・ミーツ・魔法少女", 10118, 8, 0, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 18, "ランドソル市街地", 5118068, "ナナカとの出会い", 3, 1, 40, 91002, 4109402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, "ネズ耳は二度なくなる", 10118, 8, 0, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 18, "フリーマーケット会場", 5118069, "キャル＆コッコロとの出会い", 3, 1, 40, 91002, 4305402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, "この出会いにカンパイ！", 10118, 8, 0, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 18, "ランドソル市街地", 5118070, "ユカリとの出会い", 3, 1, 40, 91002, 4101402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, "陰陽アンサンブル", 10118, 8, 0, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 18, "ランドソル市街地", 5118071, "アオイとの出会い", 3, 1, 40, 91002, 4106402);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (0, "運試し十番勝負！", 10118, 8, 1, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 7, "フリーマーケット会場", 5118072, "シノブとの出会い", 3, 1, 40, 91002, 2836);
INSERT INTO `v1_683982cb3920b24667b2e45a28ac76686b73203ef0e55f6d861c80e47229048c` VALUES (10145115, "彼女たちの新たな日常", 10118, 0, 0, 0, 0, 0, 5118600, "オープニング", 1, 0, 0, 0, 0);
